/**
 * Constructs a new transition. Both end points are included in the interval.
 * 
 * @param min transition interval minimum
 * @param max transition interval maximum
 * @param to destination state
 */
public Transition(char min, char max, State to) {
  if (max < min) {
    char t = max;
    max = min;
    min = t;
  }
  this.min = min;
  this.max = max;
  this.to = to;
}

/**
 * Constructs a new transition. Both end points are included in the interval.
 * 
 * @param min transition interval minimum
 * @param max transition interval maximum
 * @param to destination state
 */
public Transition(int min, int max, State to) {
  assert min >= 0;
  assert max >= 0;
  if (max < min) {
    int t = max;
    max = min;
    min = t;
  }
  this.min = min;
  this.max = max;
  this.to = to;
}

